import "./index.scss";
export const Error = ({ title = "", message = "", children, ...rest }) => {
  return (
    <div id="not-found-error" {...rest}>
      <label className="error-title">{title}</label>
      <p>{message}</p>
      {children}
    </div>
  );
};
